import React ,{ useState } from 'react'
import { Link } from 'react-router-dom'
import Validation from './SignupValidation';


function Signup() {
    const [values,setValues] = useState({
        firstname : '',
        lastname : '',
        email: '',
        password: ''
    })

    const [errors,setErrors] = useState({})

    const handleInput =  (event) => {
        setValues(prev => ({...prev, [event.target.name]: [event.target.value]}))
    }

    const handleSubmit = async (e) => {
        e.preventDefault();



    try {
      const response = await fetch('http://localhost:5000/signup', {
        method: 'POST',
        headers: { 'Content-Type': 'application/json' },
        body: JSON.stringify({ firstname: values.firstname, lastname: values.lastname, email: values.email, password: values.password }),
      });

      if (!response.ok) {
        setErrors('An error occurred. Please try again later.');
      } else {
        const data = await response.json();
        // Handle successful response here
        console.log(data);
      }
    } catch (error) {
      // Handle network errors or other general errors here
      console.log()
    };
 };


   
  return (
    <div className='d-flex justify-content-center align-items-center bg-primary vh-100'>
    <div className='bg-white p-3 rounded w-25'>
       <h2> Sign Up </h2>
       <form action = " " onSubmit = {handleSubmit} >
           <div className='mb-3'>
               <label htmlFor = "firstname"><strong>First Name</strong></label>
               <input type = "text" placeholder='Enter First Name' name = 'firstname'
               onChange = {handleInput} className='form-control rounded -0'/>
               {errors.firstname && <span className = 'text-danger'> {errors.firstname} </span>}
           </div>
           <div className='mb-3'>
               <label htmlFor = "lastname"><strong>Last Name</strong></label>
               <input type = "text" placeholder='Enter Last Name' name = 'lastname'
               onChange = {handleInput} className='form-control rounded -0'/>
                {errors.lastname && <span className = 'text-danger'> {errors.lastname} </span>}
           </div>
           <div className='mb-3'>
               <label htmlFor = "email"><strong>Email</strong></label>
               <input type = "email" placeholder='Enter Email' name = 'email'
               onChange = {handleInput} className='form-control rounded -0'/>
               {errors.email && <span className = 'text-danger'> {errors.email} </span>}

           </div>
           <div className='mb-3'>
               <label htmlFor = "password"><strong>Password</strong></label>
               <input type = "password" placeholder='Enter Password' name = 'password'
               onChange = {handleInput} className='form-control rounded -0'/>
               {errors.password && <span className = 'text-danger'> {errors.password} </span>}

           </div>
           <div className='mb-3'>
               <label htmlFor = "Confirm Password"><strong>Confirm Password</strong></label>
               <input type = "confirm password" placeholder=' Confirm Password' className='form-control rounded -0'/>
           </div>
           <button  type = 'submit' className='btn btn-success w-100 rounded-0'> Sign Up</button>
           <p>You agree to our terms and policies</p>
           <Link to = "/" className='btn btn-default border w-100 bg-light rounded-0 text-decoration-none'> Login </Link>
       </form>
    </div>
</div>
  )
}

export default Signup
